			async confirm() {
				console.log("confirm")
				this.alterCommit = false;
				if (this.tipsCtinm == 1 || this.tipsCtinm == 2) {
					let data = await withdraw(this.account, this.tipsCtinm == 1 ? 'AIXA' : 'USDC')
